import React, {Component} from "react";
import {
    withScriptjs,
    withGoogleMap,
    GoogleMap,
    Marker
} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteProps} from "../redux/apiMobileV2/ApiMobileV2Action";
import MapMarker from "./MapMarker";
import GoogleMapReact from "google-map-react";
import {Map} from "google-maps-react";


function RouteProps() {
    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routePropsData);
    const status = useSelector(state => state.apiMobileV2Reducer.routePropsStatus);
    React.useEffect(() => {
        dispatch(getRouteProps())
    }, []);
    console.log(data)
}

const meals = [{latitude: 41.31744719983237, longitude: 69.25418154497156, id: 10}];
class BlogMap extends Component {
    static defaultProps = {
        center: {
            lat: 41.31744719983237,
            lng: 69.25418154497156
        },
        zoom: 11
    };

    render() {
        return (
            <>
                <Map
                    style={{width:"80%",height:"60%"}}
                    google={this.props.google}
                    initialCenter={{
                        lat: 41.31744719983237,
                        lng: 69.25418154497156
                    }}
                    zoom={13}
                >
                    <Marker
                        info={"statObj"}
                        position={{ lat: 41.31744719983237, lng:69.25418154497156 }}
                        id={500}
                        onMouseover={this.props.mouseEnterHandler}
                        onMouseout={this.props.mouseLeaveHandler}
                        {...this.props}
                        icon={{
                            src: "../assets/img/tim_80x80.svg",
                        }}
                    />
                    <Marker
                        position={{lat: 37.759703, lng: -122.428093}}/>
                    <Marker/>
                </Map>
            </>
        );
    }
}
const CustomSkinMap = withScriptjs(
    withGoogleMap(() => (
        <GoogleMap
            defaultZoom={13}
            defaultCenter={{lat: 41.320052, lng: 69.253966}}
            defaultOptions={{
                scrollwheel: false,
                zoomControl: true,
            }}
        >
            {meals.map(m => {
                return (
                    <>
                        <MapMarker
                            lat={m.latitude}
                            lng={m.longitude}
                            key={m.id}
                        />
                        <MapMarker
                            lat={m.latitude}
                            lng={m.longitude}
                            key={m.id}
                        />
                    </>
                );
            })}
            <Marker position={{lat: 41.320052, lng: 69.253966}}/>
        </GoogleMap>
    ))
);

export default function Maps() {
    return (
        <CustomSkinMap
            isMarkerShown
            googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyDS4sGjQ5hi3IFNYa0dYGyuxmNZzPwv1jc"
            loadingElement={<div style={{height: `100%`}}/>}
            containerElement={<div style={{height: `80vh`}}/>}
            mapElement={<div style={{height: `100%`}}/>}
        />
    );
}
